script: |
  super -f tsv -I q3219.sql | sort > q3219.out

vector: true

inputs:
  - name: q3219.sql
    data: |
      SELECT + - 89, - col2 + + col0 AS col0 FROM tab2 AS cor0 WHERE NOT col1 - 81 IN ( - col1, + 23 );
  - name: tab2

outputs:
  - name: q3219.out
    data: |
      -89	17
      -89	23
      -89	24
